import React, { Fragment } from "react";
import Grid from '@material-ui/core/Grid';
import FormatQuoteIcon from '@material-ui/icons/FormatQuote';
import FiberManualRecordIcon from '@material-ui/icons/FiberManualRecord';
import "./index.scss";

export const AboutUs = () => {
  return (
    <Grid container className='general'>
      <Grid item xs={4} className='uno'>
        <div className='cuadradoPrimero'>
          <FiberManualRecordIcon className='circleThree'/>          
          <div className='cuadradoSegundo'>
            <p className='TextNameOne'>Susan Doe</p>
            <p className='TextSubNameTwo'>Buyer</p>
          </div>          
        </div>        
      </Grid>

      <Grid item xs={8} className='dos'>
        <div className='textBig'>
          <FormatQuoteIcon className='quotes'/>
          <h5 className='theText'>We had an incredible experience working with My Service and were 
            impressed they made such a big difference in only three weeks.
            Our team is so grateful for the wonderful improvements they made 
            and their ability to get familiar with the product concept so 
            quickly. It acted as a catalyst to take our design to the next 
            level and get more eyes on our product.</h5>
        </div>
      </Grid>
    </Grid>
  );
};
